
<form class="form-signin text-center" action="/login" method="POST">
    <div class="text-center">
        <img src="data:image/jpeg;base64," class="img-fluid text-center" alt="...">
    </div>
    <h1 class="h3 mt-3 mb-3 fw-normal text-center">Iniciar Sesion</h1>
    <div class="form-floating">
        <input type="email" class="form-control" id="email" name="email" placeholder="name@example.com">
        <label for="floatingInput">Correo electronico</label>
    </div>
    <div class="form-floating">
        <input type="password" class="form-control" id="contraseña" name="contraseña" placeholder="Password">
        <label for="floatingPassword">Contraseña</label>
    </div>
    <button class="w-100 btn btn-lg btn-primary mt-2" type="submit">Iniciar</button>
    <p class="mt-5 mb-3 text-muted">&copy; 2022–2023</p>
    <div id="alert-password-incorrect" class="alert alert-danger alert-dismissible fade show" role="alert">
        La contraseña es incorrecta.
        <button type="button" class="btn-close" data-bs-dismiss="alert" aria-label="Close"></button>
    </div>
</form>